/*
 * Generates a value for the FFT of a signal
 * with 512 FFT elements
 */
function fftGenerator(i) {
	var value = 0;
	var signalName = "";
	var functionGenerator = $("input[name='functionSelector']:checked").val();
	
	if ('undefined' === typeof functionGenerator) {
		functionGenerator = "Random";
	}
	if ("-" == functionGenerator[0]) {
		// This is coming from MATLAB, so we need
		// to shift around the elements
		signalName = functionGenerator;
		functionGenerator = "Table";
	}

	switch (functionGenerator) {
		case 'Linear': value = i / 512; break;
		case 'Flat': value = 1; break;
		case 'Sin': value = Math.sin(i / 512 * 2 * Math.PI); break;
		case 'Table': value = functionData[signalName][i]; break;
		case 'Random': default: value = Math.random(); break;
	}
	
	return value;
}

$(document).ready(function(){
	initializeVisDock();
	
	// Add the buttons for the table lookup
	for (var name in functionData) {
		$('<input type="radio" name="functionSelector" value="' + name + '">' + name + '</input>').appendTo($("#functionSelectorArea"));		
	}
	
	$("input[name='functionSelector']").change(function() {
		generateFdData();
		drawSignals();
	});
});

function initializeVisDock() {
	VisDock.init("#visDockArea", 1000, 800);
	
	generateInitialGraphic();
	
	VisDock.eventHandler = {
		getHitsPolygon: function(points, inclusive) {
			// Clear out the selection polygon
			d3.selectAll("#selection").remove();
			
			// Clear out the previously selected FFT list
			for (var i = 0; i < 512; i++) {
				fdList[i] = 0;
			}
			
			var fftElements = d3.selectAll(".fft")[0];
			var nElements = fftElements.length;
			var hits = [];
			var count = 0;
			var captured = 0;
			var shapeBound = new createPolygon(points);
			for (var i = 0; i < nElements; i++) {
				fftElements[i].setAttributeNS(null, "fill", "blue");
				captured = shapeBound.intersectPolygon(fftElements[i], inclusive);
				if (captured) {
					//fftElements[i].setAttributeNS(null, "fill", "orange");
					fdList[i] = fdData[i];
					hits[count] = i;
					count++;
				}
			}
			
			drawTdSignal();
			return hits;
		},
		getHitsEllipse: function(points, inclusive) {
			// Clear out the selection polygon
			d3.selectAll("#selection").remove();
			
			// Clear out the previously selected FFT list
			for (var i = 0; i < 512; i++) {
				fdList[i] = 0;
			}
			
			var fftElements = d3.selectAll(".fft")[0];
			var nElements = fftElements.length;
			var hits = [];
			var count = 0;
			var captured = 0;
			var shapeBound = new createEllipse(points);
			for (var i = 0; i < nElements; i++) {
				fftElements[i].setAttributeNS(null, "fill", "blue");
				captured = shapeBound.intersectPolygon(fftElements[i], inclusive);
				if (captured) {
					//fftElements[i].setAttributeNS(null, "fill", "orange");
					fdList[i] = fdData[i];
					hits[count] = i;
					count++;
				}
			}
			
			drawTdSignal();
			return hits;
		},
		setColor: function(hits) {
    		var polygonElements = d3.selectAll(".fft")[0];
    		for (var i = 0; i < hits.length; i++) {
        		VisDock.utils.addPolygonLayer(polygonElements[hits[i]]);
    		}
    	},
    	removeColor: function(hits) {
    		for (var i = 0; i < hits.length; i++) {
        		hits[i].remove();
    		}
    	},
		queryEvent: function(index) {
			for (var i = 0; i < 512; i++) {
				fdList[i] = 0;
			}
			for (var i = 0; i < VisDock.captured[index].length; i++){
				fdList[VisDock.captured[index][i]] = fdData[VisDock.captured[index][i]];
			}
			drawTdSignal();
		}
	};
}

function generateInitialGraphic() {
	var g = VisDock.getViewport();
	
	tdBox = drawSvgContainer(g, 5,   5, 775, 390, "Time Domain");
	fdBox = drawSvgContainer(g, 5, 405, 775, 390, "Frequency Domain");
	
	drawAxes(tdBox, 400, 200, 700, 300, "cartesian");
	drawAxes(fdBox, 50, 400 + 350, 700, 300);
	
	generateFdData();
	drawSignals();
}

function drawSignals() {
	drawFdSignal();
	drawTdSignal();
}

function generateFdData() {
	// Generate random FFT data
	//   and plot as bar-chart
	for (var i = 0; i < 512; i++) {
		fdData[i] = fftGenerator(i);
		fdList[i] = fdData[i];
	}
	
}

function drawFdSignal() {
	d3.selectAll(".fft").remove();
	
	max = Math.abs(fdList[0]);
	for (var i = 0; i < 512; i++) {
		if (Math.abs(fdList[i]) > max) {
			max = Math.abs(fdList[i]);
		}
	}
	
	for (var i = 0; i < 512; i++) {		
		_left = 5 + 50 + i * 700 / 512;
		_top = 600 - 150 * (fdList[i] / max);
		_right = _left + 700 / 512 * 0.9;
		_bottom = 600;
		
		drawPolygon(fdBox, [[_left, _bottom], [_left, _top], [_right, _top], [_right, _bottom]], {"fill": "blue", "class": "fft"});
	}
}

function drawTdSignal() {


	// And generate a time-domain function from its IFFT
	tdData = idct(fdList);
	
	max = tdData[1];
	min = tdData[1];
	for (var i = 1; i < 512; i++) {
		if (tdData[i] > max) max = tdData[i];
		if (tdData[i] < min) min = tdData[i];
	}
	
	points = "";
	if (max != 0){
		for (var i = 1; i < 512; i++) {
			points += (50 + i * 700 / 512) + "," + (200 - 100 * tdData[i] / max) + " "; 
		}
		// CLear any existing time-domain signal
		d3.selectAll("#tdPolyline").remove();		
		tdBox.append("polyline").attr("id","tdPolyline").attr("points", points).attr("style", "stroke: #00f; stroke-width: 2;").attr("fill", "none");
		
	}
}

function drawSvgContainer(parent, x, y, w, h, title) {
	g = parent.append("g");
	
	// Draw the outside box
	drawRect(g, [x, y, x + w, y + h], {"fill": "#ddd"});
	
	// Add the title string and line
	g.append("text")
		.attr("x", x + w / 2)
		.attr("y", y + 25)
		.attr("fill", "#444")
		.attr("font-family", "sans-serif")
		.attr("font-size", "20px")
		.attr("text-anchor", "middle")
		.text(title);
	
	drawLine(g, [x + w * 0.1, y + 35, x + w * 0.9, y + 35], {"style": "stroke: #bbb; stroke-width: 2"});
		
	return g;
}

/*
 * Draw a pair of axis lines
 * 
 * Note that (x, y) specifies the center for
 *   a cartesian coordinate space but it
 *   specifies the lower-left of the frequency
 *   domain coordinate system
 */
function drawAxes(parent, x, y, w, h, type) {
	switch (type) {
		case "cartesian":
			l1 = [x - w/2, y, x + w / 2, y];
			l2 = [x, y - h/2, x, y + h / 2];
			break;
		default:
			l1 = [x, y, x, y - h];
			l2 = [x, y - h/2, x + w, y - h/2];
			break;
	}
	
	drawLine(parent, l1, {"style": "stroke: #111; stroke-width: 1"});
	drawLine(parent, l2, {"style": "stroke: #111; stroke-width: 1"});
}

/*
 * Coords are [x1, y1, x2, y2]
 * attrs are [[name, value], [name, value], [name, value]]
 */
function drawLine(parent, coords, attrs) {
	var l = parent.append("line")
		.attr("x1", coords[0])
		.attr("y1", coords[1])
		.attr("x2", coords[2])
		.attr("y2", coords[3]);
	
	appendAttrs(l, attrs);
	
	return l;
}

/*
 * Coords are [x, y, w, h]
 * attrs are [[name, value], [name, value], [name, value]]
 */
function drawRect(parent, coords, attrs) {
	var r = parent.append("rect")
		.attr("x", coords[0])
		.attr("y", coords[1])
		.attr("width", coords[2])
		.attr("height", coords[3]);
	
	appendAttrs(r, attrs);
	
	return r;
}

/*
 * Coords are [[x, y], [x, y], [x, y]]
 * attrs are [[name, value], [name, value], [name, value]]
 */
function drawPolygon(parent, coords, attrs) {
	var p = parent.append("polygon");
	var points = "";
	for (var i = 0; i < coords.length; i++) {
		pair = coords[i];
		points += pair[0] + "," + pair[1] + " ";
	}
	p.attr("points", points)

	appendAttrs(p, attrs);
	
	return p;
}

function appendAttrs(parent, attrs) {
	// Set a default value for the attribute list
	attrs = typeof attrs !== 'undefined' ? attrs : [];
	for (var name in attrs) {
		parent.attr(name, attrs[name]);
	}
}

/*
 * Implement the dct and idct functions
 * to match MATLAB's algorithm
 */
function dct(input) {
	var output = [];
	
	for (var k = 0; k < input.length; k++) {
		value = 0;
		
		for (var n = 0; n < input.length; n++) {
			value += input[n] * Math.cos( Math.PI * (2*n+1) * k / (2 * input.length) );
		}
		
		value *= (k == 0) ? 1 / Math.sqrt(input.length) : Math.sqrt(2/input.length);
		
		output.push(value);
	}
	
	return output;
}

function idct(input) {
	var output = [];
	
	for (var n = 0; n < input.length; n++) {
		value = 0;
		
		for (var k = 0; k < input.length; k++) {
			w = (k == 0) ? 1 / Math.sqrt(input.length) : Math.sqrt(2/input.length);
			
			value += w * input[k] * Math.cos( Math.PI * (2*n+1) * k / (2 * input.length) );
		}
		
		output.push(value);
	}
	
	return output;
}

function _fft( in_array ) {
	var len = in_array.length;
	var output = new Array();
	
	for( var k=0; k < len; k++ ) {
	  	var real = 0;
	  	var imag = 0;
	  	for( var n=0; n < len; n++ ) {
	    	real += in_array[n]*Math.cos(-2*Math.PI*k*n/len);
	    	imag += in_array[n]*Math.sin(-2*Math.PI*k*n/len);
		}
		output.push( [real, imag] );
	}
	return output;
}

function _ifft(input) {
	var output = [];
	
	for (var k = 0; k < input.length; k++) {
	  	var real = 0;
	  	var imag = 0;
	  	for (var n = 0; n < input.length; n++) {
	    	real +=  input[n]*Math.cos(2*Math.PI*n*k/input.length);
	    	imag += -input[n]*Math.sin(2*Math.PI*n*k/input.length);
		}
		output.push( real );
	}
	return output;
}